import React from 'react';
import classes from "./Home.module.css";

const Home = () =>{
    return(
        <>
        <div className={classes.Home}>
         <div className={classes.Container}>
             <h1 className={classes.Hello}>
                 Welcome to my Portfolio
             </h1>
         </div>
        </div>
        </>
    );
}

export default Home;
